// src/components/InputPanel/ManualDataEntry.jsx
import React from 'react';
import { fieldDefinitions, getFieldKeys } from '../../utils/fieldDefinitions';
import { PERIOD_TYPES, MIN_PERIODS_MANUAL, MAX_PERIODS } from '../../utils/constants';

export default function ManualDataEntry({
  numberOfPeriods, // Renamed from numberOfPeriodsForManual for clarity
  onNumberOfPeriodsChange,
  periodType,
  onPeriodTypeChange,
  inputData, // This should be the manualInputData from parent
  onInputChange, // Function to update manualInputData in parent
  onSubmit,
  isLoading, // General calculation loading state
  validationErrors // Prop to pass down validation errors if any
}) {
  const fieldKeys = getFieldKeys();

  const handleLocalInputChange = (periodIndex, fieldKey, value) => {
    // Basic validation before calling parent's update
    // More complex validation might happen in parent or on submit
    onInputChange(periodIndex, fieldKey, value);
  };

  return (
    <section className="mb-8 p-6 bg-white rounded-xl shadow-lg border border-slate-200">
      <h2 className="text-xl font-semibold text-slate-700 mb-6 text-center">
        Entrada Manual de Dados Detalhada
      </h2>

      {/* Period Configuration */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
        <div>
          <label htmlFor="numberOfPeriodsEntry" className="block text-sm font-medium text-slate-700 mb-1">
            Número de Períodos ({MIN_PERIODS_MANUAL}-{MAX_PERIODS}):
          </label>
          <select
            id="numberOfPeriodsEntry"
            value={numberOfPeriods}
            onChange={(e) => onNumberOfPeriodsChange(Number(e.target.value))}
            className="w-full p-2.5 border border-slate-300 rounded-md shadow-sm focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
          >
            {Array.from({ length: MAX_PERIODS - MIN_PERIODS_MANUAL + 1 }, (_, i) => MIN_PERIODS_MANUAL + i).map(n => (
              <option key={n} value={n}>{n} Períodos</option>
            ))}
          </select>
        </div>

        <div>
          <label htmlFor="periodTypeEntry" className="block text-sm font-medium text-slate-700 mb-1">
            Tipo de Período:
          </label>
          <select 
            id="periodTypeEntry" 
            value={periodType} 
            onChange={(e) => onPeriodTypeChange(e.target.value)}
            className="w-full p-2.5 border border-slate-300 rounded-md shadow-sm focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
          >
            {Object.entries(PERIOD_TYPES).map(([key, value]) => (
              <option key={key} value={key}>{value.label}</option>
            ))}
          </select>
        </div>
      </div>

      {/* Input Table */}
      <div className="overflow-x-auto mt-4 border border-slate-300 rounded-lg">
        <table className="min-w-full border-collapse">
          <thead>
            <tr className="bg-slate-100">
              <th className="p-3 border border-slate-300 text-left text-sm font-semibold text-slate-700 sticky left-0 bg-slate-100 z-10">
                Item Financeiro
              </th>
              {inputData && inputData.map((_, index) => (
                <th key={index} className="p-3 border border-slate-300 text-center text-sm font-semibold text-slate-700">
                  Período {index + 1} <span className="font-normal text-xs">({PERIOD_TYPES[periodType]?.shortLabel || periodType})</span>
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {fieldKeys.map(fieldKey => {
              const def = fieldDefinitions[fieldKey];
              return (
                <tr key={fieldKey} className="hover:bg-slate-50">
                  <td className="p-3 border border-slate-300 text-sm text-slate-600 sticky left-0 bg-white z-10" title={def.note || ''}>
                    <div className="font-medium">{def.label}</div>
                    {def.note && (
                      <div className="text-xs text-slate-400 mt-1">({def.note})</div>
                    )}
                  </td>
                  {inputData && inputData.map((periodData, periodIndex) => {
                    const isDisabled = def.firstPeriodOnly && periodIndex > 0;
                    const fieldError = validationErrors?.find(pErr => pErr.period === periodIndex + 1)?.fields[fieldKey];
                    return (
                      <td key={`${fieldKey}-${periodIndex}`} className="p-2 border border-slate-300">
                        <input
                          type="number"
                          step={def.type === 'percentage' || def.type === 'days' ? "0.01" : "any"}
                          placeholder={isDisabled ? "N/A" : "0"}
                          disabled={isDisabled}
                          value={isDisabled ? '' : (periodData?.[fieldKey] === null || typeof periodData?.[fieldKey] === 'undefined' ? '' : periodData[fieldKey])}
                          onChange={(e) => handleLocalInputChange(periodIndex, fieldKey, e.target.value)}
                          className={`w-full p-2 border rounded-md text-sm text-right transition focus:ring-2 focus:ring-blue-500 focus:border-blue-500 ${isDisabled ? 'bg-slate-100 cursor-not-allowed text-slate-500' : fieldError ? 'border-red-500 bg-red-50' : 'border-slate-200 hover:border-slate-300'}`}
                          aria-invalid={!!fieldError}
                          aria-describedby={fieldError ? `${fieldKey}-${periodIndex}-error` : undefined}
                        />
                        {fieldError && <p id={`${fieldKey}-${periodIndex}-error`} className="text-xs text-red-600 mt-1">{fieldError}</p>}
                      </td>
                    );
                  })}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      <div className="text-center mt-8">
        <button
          onClick={onSubmit}
          disabled={isLoading}
          className="px-8 py-3 bg-blue-600 text-white font-semibold rounded-lg shadow-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-opacity-50 transition duration-150 disabled:opacity-50 disabled:cursor-not-allowed"
        >
          {isLoading ? (
            <div className="flex items-center justify-center space-x-2">
              <div className="animate-spin rounded-full h-5 w-5 border-2 border-white border-t-transparent"></div>
              <span>Processando...</span>
            </div>
          ) : (
            'Gerar Relatório com Dados Manuais'
          )}
        </button>
      </div>
    </section>
  );
}
